import React from 'react';
import Tilt from 'react-tilt'
const Logo = () => {
    return (
       <div className='ma4 mt0'>
            <Tilt className='Tilt' options={{max:25}} style ={{height:250, width:100}}>
                    <div className='Tilt-inner'></div>
            </Tilt>

       </div>
    );
}

export default Logo
